export const defaultSensors = [
  { id: 1, name: 'Sensor Norte', region: 'Antofagasta', status: 'ok', value: '23°C' },
  { id: 2, name: 'Sensor Centro', region: 'Valparaíso', status: 'alert', value: '85% humedad' },
  { id: 3, name: 'Sensor Sur', region: 'Los Lagos', status: 'ok', value: '18°C' },
  { id: 4, name: 'Sensor Andes', region: 'Maule', status: 'alert', value: 'Alta presión' },
];
